import { useEffect, useState } from 'react';

export const useTheme = () => {
  const [theme, setTheme] = useState<string>('light');
  const [data, setData] = useState<Object | null>(null);

  const fetchData = async () => {
    try {
      setData({});
    } catch (error) {}
  };

  useEffect(() => {
    fetchData();
  }, []);

  return {
    data,
    theme,
    setTheme,
  };
};
